Defendant Commosie Deshawn Thompson in court with attorney Jonathan Carver Smith.  Defendant Commosie Deshawn Thompson in custody.  Grant Huebner appeared for the State of Wisconsin.  Sentencing proceeded.  PSI gone over.  Statements by the State, defense and defendant.  Additional statements by: Ms. Sheila H.  The Court imposed the following sentence:


Defendant's TOTAL LENGTH OF SENTENCE shall be 16 years consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 10 years.  Defendant shall serve 6 years on EXTENDED SUPERVISION.  The defendant is not eligible for the Challenge Incarceration Program or the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 
 * Court ordered defendant to provide a DNA sample if one was not previously provided.
 * Court ordered defendant to pay restitution to Sheila H. in the amount of $12,545.00 to be paid first; then, the DNA surcharge, costs and disbursements.  Court ordered monies taken from prison funds not to exceed 25%.  Balance to be paid while on extended supervision.

 CONDITIONS OF EXTENDED SUPERVISION:
 - No contact with the victim's mother or  family;
 - Comply with any and all court orders;
 - Obtain and maintain full time employment;
 - AODA for drugs and alcohol;
 - Undergo a mental health evaluation;
 - Pay balance remaining of restitution, costs and surcharges.  Failure to pay would result in a civil judgment entered against defendant.

Court advised defendant that as a convicted felon he may no longer use or possess firearms or body armor and that he cannot vote until his civil rights have been restored.

